import React from 'react';
import { useLocation } from 'react-router-dom'

function Banner() {
  const location = useLocation()
  const header = (location) => {
    switch (location.pathname.split('/')[3]) {
      case 'new-arrivals':
        return 'New Arrivals'
        break;
      case 'home-bath':
        return 'Home + Bath'
        break;
      case 'new-arrivals':
        return 'New Arrivals'
        break;
      case 'new-arrivals':
        return 'New Arrivals'
        break;
      case 'new-arrivals':
        return 'New Arrivals'
        break;

      default:
        break;
    }
  }

  return (
    <div className='banner'>
      <div className='banner-location'>{header(location)}</div>
      <div>
        <img src="" alt="" />
      </div>

    </div>
  );
}

export default Banner;
